import React from 'react';
import './Hero.css';

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-background"></div>
      <div className="container">
        <div className="hero-content">
          <h1 className="hero-title">
            TechFocus
            <br />
            Let's shape the future
          </h1>
        </div>
      </div>
    </section>
  );
};

export default Hero;
